Okay, I have a question for everyone. Seriously, not to offend Furries anywhere, but I kind of find furry-dom or whatever it's called kind of weird, and at times it can be disgusting, especially when it comes to extreme furries who make weird porn an whatnot. But here's the question;

What does this movie have to do with furries?

I mean seriously, they're sentient animals who walk around without humans and wear clothes? Not sure where furry comes into the equation at all, unless we want to call movies like Chicken Little, Disney's Robin Hood, Madagascar, and everything to do with Mickey Mouse furry content as well. Does someone want to enlighten me on this? I personally find this to be quite an intriguing movie thus far.
